import React from 'react';
import Product from './Product';

class Products extends React.Component {
  render() {
  	return (
      <div>
        <Product contentName={this.state.modalContent} currentIndex={this.state.index} closeModal={this.closeModal} interval={null}/>
      </div>
  	);
  }
}
export default Products;
